import './home.css';
import fact2 from '../images/Fact-2.png';
import fact1 from '../images/Fact-1.png';
import fact3 from '../images/Fact-3.png';
import fact4 from '../images/Fact-4.jpg';
import fact5 from '../images/Fact-5.jpg';
import fact6 from '../images/Fact-6.jpg';
import fact7 from '../images/Fact-7.jpg';
import fact8 from '../images/Fact-8.jpg';
import fact9 from '../images/Fact-9.jpg';
import back from "./back.png";
import React, { useRef, useState, useEffect, useCallback } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { useTransition, animated } from '@react-spring/web';
import Text from '../text';
import Section from '../Section';
import Nav from '../Nav';

import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/effect-coverflow';
import 'swiper/css/pagination';
import './style.css';

import { EffectCoverflow, Pagination } from 'swiper/modules';

function Home() {
  const ref = useRef([]);
  const [items, set] = useState([]);
  const transitions = useTransition(items, {
    from: {
      opacity: 0,
      height: 0,
      innerHeight: 0,
      transform: 'perspective(600px) rotateX(0deg)',
      color: '#8fa5b6',
    },
    enter: [
      { opacity: 1, height: 80, innerHeight: 80 },
      { transform: 'perspective(600px) rotateX(180deg)', color: '#28d79f' },
      { transform: 'perspective(600px) rotateX(0deg)' },
    ],
    leave: [{ color: '#c23369' }, { innerHeight: 0 }, { opacity: 0, height: 0 }],
    update: { color: '#28b4d7' },
    loop: Infinity,
  });

  const reset = useCallback(() => {
    ref.current.forEach(clearTimeout);
    ref.current = [];
    set([]);
    ref.current.push(setTimeout(() => set(['ReCycle', 'Reduce', 'ReUse']), 2000));
    ref.current.push(setTimeout(() => set(['ReCycle', 'ReUse']), 5000));
    ref.current.push(setTimeout(() => set(['ReCycle', '', 'ReUse']), 8000));
  }, []);

  useEffect(() => {
    reset();
    return () => ref.current.forEach(clearTimeout);
  }, []);

  return (
    <>
      <Nav />
      <div className="hero min-h-screen flex bg-base-200">
        <div className="max-w-5xl mx-auto px-4 py-12 sm:px-6 lg:px-8 flex justify-end items-center w-1/2">
          <img src={back} alt="Background Image" className="w-full h-auto" />
        </div>
        <div className="max-w-5xl mx-auto px-4 py-12 sm:px-6 lg:px-8 w-1/2">
          <div className="hero-content flex flex-col lg:flex-row-reverse items-center">
            <div className="lg:w-1/2 flex flex-col justify-center">
              <div className="container">
                {transitions(({ innerHeight, ...rest }, item) => (
                  <animated.div className="transitionsItem" style={rest} onClick={reset}>
                    <animated.div style={{ overflow: 'hidden', height: innerHeight }}>{item}</animated.div>
                  </animated.div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>

      <Text />

      <Swiper
        effect={'coverflow'}
        grabCursor={true}
        centeredSlides={true}
        slidesPerView={'auto'}
        coverflowEffect={{
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true,
        }}
        pagination={true}
        modules={[EffectCoverflow, Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src={fact9} alt="Fact 9" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact1} alt="Fact 1" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact8} alt="Fact 8" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact3} alt="Fact 3" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact5} alt="Fact 5" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact4} alt="Fact 4" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact6} alt="Fact 6" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact2} alt="Fact 2" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={fact7} alt="Fact 7" />
        </SwiperSlide>
      </Swiper>

      <Section />
    </>
  );
}

export default Home;
